import {
  Button,
  Cascader,
  FloatButton,
  Form,
  Input,
  Select,
  TreeSelect,
} from "antd";

const TaskForm = () => {
  let PriorityOptions = [
    { value: "One" },
    { value: "Two" },
    { value: "Three" },
  ];
  let StatusOptions = [
    { value: "New" },
    { value: "In Progress" },
    { value: "Complete" },
    { value: "Discarded" },
  ];

  return (
    <div style={{ textAlign: "center" }}>
      <h1>TODO - APP</h1>
      <div>
        <Form
          labelCol={{
            span: 4,
          }}
          wrapperCol={{
            span: 14,
          }}
          layout="horizontal"
          style={{
            maxWidth: 600,
          }}
        >
          <Form.Item label="Task">
            <Input />
          </Form.Item>
          <Form.Item label="Priority">
            <Select options={PriorityOptions} />
          </Form.Item>
          <Form.Item label="Status">
            <Select options={StatusOptions} />
          </Form.Item>
        </Form>
      </div>
      <div style={{gap:'15px'}}>
        <Button color="primary" variant="solid" style={{ width: "10vw" }}>
          Add Task
        </Button>
        <Button color="danger" variant="solid" style={{ width: "10vw" }}>
          Reset
        </Button>
      </div>
    </div>
  );
};
export default TaskForm;
